import React from 'react';
import { SongData } from '../types/song';

interface TopSectionProps {
  songData: SongData | null;
}

export const TopSection: React.FC<TopSectionProps> = ({ songData }) => {
  if (!songData) return null;

  return (
    <div className="song-info-compact">
      <div className="album-art-compact">
        <img 
          src={songData.album_art || "/api/placeholder/150/150"} 
          alt={`${songData.album} album art`} 
        />
      </div>
      <div className="song-details-compact">
        <h1 className="song-title">{songData.title}</h1>
        <p className="artist-name">{songData.artist}</p>
        <p className="album-name">{songData.album}</p>
      </div>
    </div>
  );
};
